<script>
	import { onMount } from 'svelte';
	import { data } from '$lib/data.js';

	export let selectedPlot;
	let prevSelectedPlot;

	let map;

	let isHovered = false;
	let x;
	let y;

	let x1, x2, y1, y2;
	let distance;

	let title = null;

	const xOffset = 10;
	const yOffset = -5;

	const mouseenter = (e) => {
		isHovered = true;
		x = e.pageX + xOffset;
		y = e.pageY + yOffset;
		title = data[e.target.id] ? data[e.target.id].name : `Plot ${e.target.id}`;
	};

	const mousemove = (e) => {
		x = e.pageX + xOffset;
		y = e.pageY + yOffset;
	};

	const mouseleave = (e) => {
		isHovered = false;
		title = null;
	};

	const click = (e) => {
		e.stopPropagation();
		if (e.target.id === 'map') {
			selectedPlot = null;
		} else if (selectedPlot !== e.target.id) {
			selectedPlot = e.target.id;
		} else {
			selectedPlot = null;
		}
	};

	const contextmenu = (e) => {
		e.preventDefault();

		if (!x1 && !y1) {
			x1 = e.offsetX;
			y1 = e.offsetY;
		} else if (!x2 && !y2) {
			x2 = e.offsetX;
			y2 = e.offsetY;
			distance = calcDistance(x1, y1, x2, y2);
		} else {
			x1 = null;
			y1 = null;
			x2 = null;
			y2 = null;
			distance = null;
		}
	};

	function updateSelected() {
		map?.getElementById(selectedPlot)?.classList.add('fill-blue-500');
		map?.getElementById(prevSelectedPlot)?.classList.remove('fill-blue-500');
		prevSelectedPlot = selectedPlot;
	}

	$: selectedPlot, updateSelected();

	function calcDistance(x1, x2, y1, y2) {
		const planetaryRadius = 6378; // km at the equator

		let mapWidth = map.getBoundingClientRect().width;
		let mapHeight = map.getBoundingClientRect().height;

		let longitude1 = ((x1 / mapWidth) * (44.93 * 2) - 44.93) * (Math.PI / 180);
		let latitude1 = ((y1 / mapHeight) * -90 + 20) * (Math.PI / 180);

		let longitude2 = ((x2 / mapWidth) * (44.93 * 2) - 44.93) * (Math.PI / 180);
		let latitude2 = ((y2 / mapHeight) * -90 + 20) * (Math.PI / 180);

		console.log('1: ', (x1 / mapWidth) * (44.93 * 2) - 44.93, (y1 / mapHeight) * -90 + 20);
		console.log('2: ', (x2 / mapWidth) * (44.93 * 2) - 44.93, (y2 / mapHeight) * -90 + 20);

		console.log('longitude1: ', longitude1);
		console.log('latitude1: ', latitude1);
		console.log('longitude2: ', longitude2);
		console.log('latitude2: ', latitude2);

		let deltaX =
			Math.cos(latitude2) * Math.cos(longitude2) - Math.cos(latitude1) * Math.cos(longitude1);
		let deltaY =
			Math.cos(latitude2) * Math.sin(longitude2) - Math.cos(latitude1) * Math.sin(longitude1);
		let deltaZ = Math.sin(latitude2) - Math.sin(latitude1);

		console.log('deltaX: ', deltaX, '\ndeltaY: ', deltaY, '\ndeltaZ: ', deltaZ);

		let chordLength = Math.sqrt(deltaX ** 2 + deltaY ** 2 + deltaZ ** 2);

		console.log('chordLength: ', chordLength);

		let distance = 2 * Math.asin(chordLength / 2) * planetaryRadius;

		return distance;
	}

	onMount(() => {
		document.querySelectorAll('title').forEach((title) => title.remove());

		map = document.getElementById('map');

		let paths = document.querySelectorAll('path');

		map.addEventListener('click', click);
		map.addEventListener('contextmenu', contextmenu);

		paths.forEach((path) => {
			path.addEventListener('mouseenter', mouseenter);
			path.addEventListener('mousemove', mousemove);
			path.addEventListener('mouseleave', mouseleave);
			path.addEventListener('click', click);
		});

		return () => {
			paths.forEach((path) => {
				path.removeEventListener('mouseenter', mouseenter);
				path.removeEventListener('mousemove', mousemove);
				path.removeEventListener('mouseleave', mouseleave);
				path.removeEventListener('click', click);
			});
		};
	});
</script>

{#if isHovered}
	<div
		style="top: {y}px; left: {x}px;"
		class="absolute bg-gray-700 text-white px-2 py-0.5 rounded shadow z-50"
	>
		{title}
	</div>
{/if}

<!-- prettier-ignore-start -->
<div>
{#if distance}
	<p>Calculated distance: {distance.toFixed(2)} km</p>
{/if}

